import React from "react";
import './searchBar.css';

const SearchBar = ({ placeholder = "Rechercher..." }) => {
  return (
    <input
      type="text"
      className="form-control rounded-pill border-secondary"
      placeholder={placeholder} />
  );
};

export default SearchBar;
